import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { RootState, AppDispatch } from '../store';
import { fetchSchema } from '../store/dataSlice';
import SchemasTree from '../components/data/SchemasTree';
import DataTable from '../components/data/DataTable';
import LoadingSpinner from '../components/common/LoadingSpinner';
import './DataPage.css';

const DataPage: React.FC = () => {
  const dispatch = useDispatch<AppDispatch>();
  const { schema, isLoading, error } = useSelector((state: RootState) => state.data);
  const [selectedQuery, setSelectedQuery] = React.useState<string | null>(null);
  const [queryResult, setQueryResult] = React.useState<any>(null);
  const [executingQuery, setExecutingQuery] = React.useState(false);

  React.useEffect(() => {
    dispatch(fetchSchema());
  }, [dispatch]);

  return (
    <div className="data-page">
      <div className="page-header">
        <h1>üìä Data Schema Explorer</h1>
        <p>
          Explore your database schema, understand table relationships, 
          and execute queries to analyze your data.
        </p>
      </div>

      <div className="data-content">
        <div className="schema-panel">
          <SchemasTree />
        </div>

        <div className="query-panel">
          <div className="query-section">
            <h3>Query Builder</h3>
            <div className="query-editor">
              <textarea
                placeholder="Write your SQL query here or use the schema explorer to build one..."
                value={selectedQuery || ''}
                onChange={(e) => setSelectedQuery(e.target.value)}
                rows={8}
                className="sql-editor"
              />
              <div className="query-controls">
                <button 
                  className="execute-btn"
                  disabled={!selectedQuery || executingQuery}
                  onClick={() => {
                    // TODO: Implement query execution
                    console.log('Executing:', selectedQuery);
                  }}
                >
                  {executingQuery ? 'Executing...' : '‚ñ∂ Execute Query'}
                </button>
                <button 
                  className="clear-btn"
                  onClick={() => {
                    setSelectedQuery(null);
                    setQueryResult(null);
                  }}
                >
                  Clear
                </button>
              </div>
            </div>
          </div>

          {(queryResult || executingQuery) && (
            <div className="results-section">
              <DataTable 
                data={queryResult} 
                loading={executingQuery}
                error={null}
              />
            </div>
          )}

          {!queryResult && !executingQuery && (
            <div className="getting-started">
              <h3>Getting Started</h3>
              <div className="tips-grid">
                <div className="tip-card">
                  <h4>üóÇÔ∏è Explore Tables</h4>
                  <p>Click on table names in the schema panel to expand and view columns.</p>
                </div>
                <div className="tip-card">
                  <h4>üîó View Relationships</h4>
                  <p>See how tables are connected through foreign keys and join paths.</p>
                </div>
                <div className="tip-card">
                  <h4>‚úèÔ∏è Write SQL</h4>
                  <p>Use the query editor to write and execute custom SQL queries.</p>
                </div>
                <div className="tip-card">
                  <h4>üìà Analyze Results</h4>
                  <p>View query results in a structured table with sorting and statistics.</p>
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default DataPage;
